import { RouterProvider, createBrowserRouter } from 'react-router-dom'
import CatDetailPage, { loader as catDetailLoader } from './pages/CatDetail';
import CatsPage, { loader as catsLoader } from './pages/Cats';
import CatsRootLayout from './pages/CatsRoot';
import EditCatPage from './pages/EditCat';
import ErrorPage from './pages/Error';
import HomePage from './pages/Home';
import NewCatPage from './pages/NewCat';
import RootLayout from './pages/Root';

// working with loaders:
// loader property which requires a function
// function will be executed when the route is visited
// remove state value settings
// the loader function can be imported from the component

const router = createBrowserRouter([
	{ 
		path: '/', 
		element: <RootLayout />, 
		errorElement: <ErrorPage />,
		children: [
			{ index: true, element: <HomePage /> },
			{ 
				path: 'cats', 
				element: <CatsRootLayout />, children: [
					{ 
						index: true, 
						element: <CatsPage /> , 
						loader: catsLoader
					},
					{
						path: ':catId',
						children: [
							{ 
								index: true, 
								element: <CatDetailPage />,
								loader: catDetailLoader
							},
							{ path: 'new', element: <NewCatPage /> }
						]
					},
					{ path: 'edit', element: <EditCatPage /> }
				] 
			},	
		]
	},
])

function App() {
	return (
		<RouterProvider router={router} />
	)
}

export default App;
